CREATE TABLE IF NOT EXISTS public.client
(
    id uuid NOT NULL,
    identification text COLLATE pg_catalog."default" NOT NULL,
    full_name text COLLATE pg_catalog."default" NOT NULL,
    contact_phone text COLLATE pg_catalog."default",
    CONSTRAINT client_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.product
(
    id uuid NOT NULL,
    name text COLLATE pg_catalog."default" NOT NULL,
    prize numeric,
    stock numeric,
    CONSTRAINT product_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.purchase
(
    id uuid NOT NULL,
    transaction_time timestamp with time zone NOT NULL,
    client_id uuid NOT NULL,
    payment_method text COLLATE pg_catalog."default" NOT NULL,
    total numeric,
    CONSTRAINT purchase_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.purchase_detail
(
    id uuid NOT NULL,
    purchase_id uuid NOT NULL,
    product_id uuid NOT NULL,
    items numeric,
    subtotal numeric,
    CONSTRAINT purchase_detail_pkey PRIMARY KEY (id)
);

